Explorations that shaped the world (Tell Me Why #92)
By Manorama
Manorama | May 2014 | PDF | 98 pages | 17 mb
scanned to PDF by me.

Man, by nature, is an explorer. He has been driven by the urge to explore new horizons ever since the known history began. The early travellers all set out on their jou rneys for a reason . The Egyptians, the Phoenicians and the Greeks travelled for trade just like the Europeans in later years.
With an eye on wealth , the European explorers succeeded in charting much of the rest of the globe. Every continent has been explored, from the tropical jungles to the icy poles. Their explorations shaped the world and its civilizations.
In this issue of Tell Me Why, we tell you of some extraordinary explorations that defined the world we know today.
